import React from 'react';
import styled from 'styled-components';
import Button from './Button';
import { useInView } from 'react-intersection-observer';

const packages = [
  {
    title: '1 Bedroom Smart Package',
    price: '$17,000',
    features: [
      'Smart lighting (5 zones)',
      'Audio system (4 speakers)',
      '1 smart thermostat',
      '1 video doorbell',
      '1 smart touchscreen',
      '2 Wi-Fi access points',
      'Smart lock',
      'Full installation + network setup',
    ],
  },
  {
    title: '2 Bedroom Smart Package',
    price: '$24,000',
    features: [
      'Smart lighting (7 zones)',
      'Audio (6 speakers)',
      '2 thermostats',
      'Video doorbell + touchscreen',
      'Smart lock',
      'Control4 automation hub',
      'Full install + tuning',
    ],
    featured: true,
  },
  {
    title: '3 Bedroom Smart Package',
    price: '$33,000',
    features: [
      'Smart lighting (10 zones)',
      'Audio (8–10 speakers)',
      '3 thermostats',
      'Touchscreen x2 + TV control',
      'Video doorbell + smart lock',
      'Full network + access points',
      'Intercom/gate options',
    ],
  },
  {
    title: 'Custom Luxury Homes',
    price: 'Starting at $50,000+',
    features: [
      'Full panelized lighting',
      'Multi-zone audio/video',
      'In-ceiling speakers',
      'Motorized shades',
      'Rack system & power conditioning',
      'Full-service engineering + install',
    ],
  },
];

const PackagesSection = styled.section`
  padding: 100px 0;
  background-color: var(--white);
  position: relative;

  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background: radial-gradient(circle at 90% 10%, var(--primary) 0%, transparent 30%);
    opacity: 0.03;
    z-index: 0;
  }
`;

const Container = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 20px;
  position: relative;
  z-index: 1;
`;

const SectionHeader = styled.div`
  text-align: center;
  margin-bottom: 60px;

  h2 {
    color: var(--secondary);
    margin-bottom: 15px;
  }

  p {
    font-size: 1.1rem;
    max-width: 700px;
    margin: 0 auto;
    color: var(--secondary);
  }
`;

const PackagesGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(4, 1fr);
  gap: 25px;

  @media (max-width: 1100px) {
    grid-template-columns: repeat(2, 1fr);
  }

  @media (max-width: 576px) {
    grid-template-columns: 1fr;
  }
`;

const PackageCard = styled.div<{ featured?: boolean }>`
  background-color: ${props => props.featured ? 'var(--white)' : 'var(--white)'};
  border-radius: 10px;
  padding: 30px;
  box-shadow: ${props => props.featured ? '0 10px 30px rgba(0, 0, 0, 0.08)' : '0 5px 15px rgba(0, 0, 0, 0.05)'};
  transition: var(--transition);
  border: ${props => props.featured ? '2px solid var(--primary)' : '1px solid rgba(0, 0, 0, 0.05)'};
  position: relative;
  transform: ${props => props.featured ? 'scale(1.05)' : 'scale(1)'};
  z-index: ${props => props.featured ? '2' : '1'};

  &:hover {
    transform: translateY(-5px);
    box-shadow: 0 15px 35px rgba(0, 0, 0, 0.1);
  }

  @media (max-width: 1100px) {
    transform: scale(1);
  }
`;

const PopularTag = styled.div`
  position: absolute;
  top: -12px;
  right: 20px;
  background-color: var(--primary);
  color: var(--white);
  padding: 5px 15px;
  font-size: 0.8rem;
  font-weight: 600;
  border-radius: 20px;
  box-shadow: 0 5px 15px rgba(203, 157, 118, 0.3);
`;

const PackageTitle = styled.h3`
  margin-bottom: 10px;
  color: var(--secondary);
  font-size: 1.5rem;
`;

const PackagePrice = styled.div`
  font-size: 1.8rem;
  font-weight: 600;
  color: var(--primary);
  margin-bottom: 20px;
`;

const FeaturesList = styled.ul`
  list-style: none;
  padding: 0;
  margin-bottom: 30px;

  li {
    padding: 8px 0;
    border-bottom: 1px solid rgba(0, 0, 0, 0.05);
    display: flex;
    align-items: center;

    &:last-child {
      border-bottom: none;
    }

    &::before {
      content: '✓';
      color: var(--primary);
      margin-right: 10px;
      font-weight: bold;
    }
  }
`;

const Packages = () => {
  const { ref, inView } = useInView({
    threshold: 0.1,
    triggerOnce: true,
  });

  const scrollToSection = (sectionId: string) => {
    const section = document.getElementById(sectionId);
    if (section) {
      section.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <PackagesSection id="packages" ref={ref}>
      <Container>
        <SectionHeader className={inView ? 'fade-in' : ''}>
          <h2>Choose Your Smart Home Package</h2>
          <p>
            Select the perfect smart home solution for your space. Each package 
            includes professional design, installation, and programming. Custom 
            options available.
          </p>
        </SectionHeader>

        <PackagesGrid>
          {packages.map((pkg, index) => (
            <PackageCard 
              key={index} 
              featured={pkg.featured}
              className={inView ? `slide-up delay-${index % 3}` : ''}
            >
              {pkg.featured && <PopularTag>Most Popular</PopularTag>}
              <PackageTitle>{pkg.title}</PackageTitle>
              <PackagePrice>{pkg.price}</PackagePrice>

              <FeaturesList>
                {pkg.features.map((feature, i) => (
                  <li key={i}>{feature}</li>
                ))}
              </FeaturesList>

              <Button 
                primary={pkg.featured} 
                fullWidth
                onClick={() => scrollToSection('contact')}
              >
                Start With This Package
              </Button>
            </PackageCard>
          ))}
        </PackagesGrid>
      </Container>
    </PackagesSection>
  );
};

export default Packages;
